var búinn að sjá þetta á supraforums.  Þeir voru líka búnir að pósta dyno testinu á M3 með Horse Power freaks Turbo kit og hann dynoaði 671rwhp @ 13.5 psi  sem er helvíti gott  :wink: 

og nátturulega mjög gott miðað við að M3-Inn er með  stock engine, stock head og stock exhaust <<<icon_smile.gif>>> 

en mig mig minnir að þeir þurfi að nota Race gas ef þeir blása meira en 5.5 psi held að hann sé 500rwhp @ 5 psi á pump gas
